import Layout from "../components/Layout";
import { Block } from "../components/Block";
import { DarkBlock } from "../components/DarkBlock";
const HomePage = () => {
  return (
    <>
      <Layout>
        <Block />
      </Layout>
      <DarkBlock />
      <div></div>
    </>
  );
};

export default HomePage;
